import user_history from "../../data/history/user_history";
import phone_history from "../../data/history/phone_history.json"
import * as style from "../../css/light/focusedList"

export default function History(props) {
  const renderItems = () => {
    if (props.profile[1] === "users") return user_history[props.profile[0]].map((item, i) => <div style={{marginLeft: "5px"}}>{item}</div>)
    if (props.profile[1] === "phones") return phone_history[props.profile[0]].map((item, i) => <div style={{marginLeft: "5px"}}>{item}</div>)
  }

  return (
    <div style={{position: "absolute", top: "500px"}}>
      <div style={style.focusTitle}>Profile History</div>
      <div style={{...style.divider, margin: "3px 0px 6px 8px", width: "32.1vw"}}/>
      <div style={style.focusHistoryContainer}>{renderItems()}</div>
    </div>
  )
}
